import React from 'react';
import PostChirp from '../atoms/PostChirp';
import Chirp from '../atoms/Chirp';

class Feed extends React.Component {

    constructor() {
        super();
        this.state = {
            chirps: []
        }
    }
    componentDidMount() {
        fetch("http://localhost:8080/feed")
            .then(res => res.json())
            .then(res => {
                this.setState({
                    chirps: JSON.parse(res)
                })
            });
    }

    render() {
        return (
            <div className="feed">
                <PostChirp key="1" />
                {this.state.chirps.forEach(value => {
                    <Chirp key="1" title={value.title} text={value.text} user={value.user} />
                })};
            </div>
        );
    }
  }

  export default Feed;
